class Solution {
    public int[][] constructProductMatrix(int[][] grid) {
        int n = grid.length;
        int m = grid[0].length;
        int[][] p = new int[n][m];

        // Pre-calculate row and column products
        long[] rowProduct = new long[n];
        long[] colProduct = new long[m];
        for (int i = 0; i < n; i++) {
            rowProduct[i] = 1;
            for (int j = 0; j < m; j++) {
                rowProduct[i] = (rowProduct[i] * grid[i][j]) % 12345;
            }
        }
        for (int j = 0; j < m; j++) {
            colProduct[j] = 1;
            for (int i = 0; i < n; i++) {
                colProduct[j] = (colProduct[j] * grid[i][j]) % 12345;
            }
        }

        // Calculate the product matrix
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < m; j++) {
                long product = 1;
                for (int k = 0; k < n; k++) {
                    if (k != i) product = (product * grid[k][j]) % 12345;
                }
                for (int k = 0; k < m; k++) {
                    if (k != j) product = (product * grid[i][k]) % 12345;
                }
                p[i][j] = (int) (product % 12345);
            }
        }

        return p;
    }
}
